import React from 'react';
import ids from '../../channelId/ids';
import { apiKey, YOUTUBEURL, PLAYLISTS, PLAYLISTSITEMS } from '../../API/apis';
import Modal from 'react-modal';
import PlayMovie from './PlayMovie';
import { useState } from 'react';

const MarvelPlist = () => {
  const [playlist, setPlaylist] = useState([]);
  const [plistItem, setPlistItem] = useState([]);

  const getPlaylist = async () => {
    const pList = await (
      await fetch(`
                ${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${ids.MarvelKorea}&maxResults=10&part-id,snippet
            `)
    ).json();
    setPlaylist(pList.items);
        //playlist 에서 playlistId 를 빼서 배열에 저장하고 그 배열을 돌면서 
    const plistItem = await (
      await fetch(`
                ${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&channelId=${ids.MarvelKorea}&maxResults=10&part-id,snippet
            `)
    ).json();
    setPlistItem(plistItem);
  };
  return <div></div>;
};

export default MarvelPlist;
